import * as React from 'react';
import * as ReactDOM from "react-dom";
import { ListViewComponent } from '@syncfusion/ej2-react-lists';
import '../HospitalBagChecklist/Checklist.css'
export default class App extends React.Component {
    constructor() {
        super(...arguments);
        //define the array of JSON
        this.data = [
            { text: 'Do Meditation', id: '1' },
            { text: 'Go Jogging', id: '2' },
            { text: 'Buy Groceries', id: '3' },
            { text: 'Pay Phone bill', id: '4' },
            { text: 'Play Football with your friends', id: '5' },
        ];
    }
    render() {
        return (
        // specifies the tag to render the ListView component
        <ListViewComponent id='list' dataSource={this.data} showCheckBox={true} headerTitle='What the hospital will ask you for:' showHeader={true}></ListViewComponent>);
    }
}
